import React from 'react';
import Header from "./Header";
import BackgroounfImage from "./Backgroud"
import "node_modules/video-react/dist/video-react.css"; // import css
import Gallery from "./Gallery"

function App(){
    return <div >
        <Header />
        <BackgroounfImage />
        <Gallery />
    </div> 
}

export default App;
